import React from "react";

function Home() {
  return (
    <div className="max-w-7xl mx-auto px-4 py-6">
      {/* Search */}
<div className="bg-gradient-to-r from-gray-800 to-black p-6 rounded-lg text-white">
  <h2 className="text-lg font-semibold mb-2">Zinc Blockchain Explorer</h2>
  <div className="flex items-center gap-2">
    <input
      type="text"
      placeholder="Search by Address / Txn Hash / Block..."
      className="flex-grow px-4 py-2 rounded text-white placeholder-gray-300"
      style={{ backgroundColor: '#36454F' }}
    />
    <button
      className="px-4 py-2 rounded text-white"
      style={{ backgroundColor: '#F97316' }}
    >
      üîç
    </button>
  </div>
</div>


      {/* Top Stats */}
      <div className="grid md:grid-cols-3 lg:grid-cols-6 gap-4 my-6">
        <Stat title="ZINC PRICE" value="$123.45" />
        <Stat title="TRANSACTIONS" value="1,234,567" />
        <Stat title="AVG GAS PRICE" value="0.1 Zinc" />
        <Stat title="MARKET CAP" value="$567,890,123" />
        <Stat title="LATEST BLOCK" value="123456" />
        <Stat title="VOTING POWER" value="98,000 ZNC" />
      </div>

      {/* Graph */}
      <div className="bg-white p-4 rounded shadow mb-6">
        <div className="h-32 flex items-center justify-center text-gray-400">[ Transaction History Graph Placeholder ]</div>
      </div>

      {/* Latest Blocks and Txns */}
      <div className="grid md:grid-cols-2 gap-4">
        <LatestBlocks />
        <LatestTransactions />
      </div>
    </div>
  );
}

const Stat = ({ title, value }) => (
  <div className="bg-white p-4 rounded shadow text-center">
    <div className="text-sm text-gray-500">{title}</div>
    <div className="font-bold text-xl">{value}</div>
  </div>
);

const LatestBlocks = () => (
  <div className="bg-white p-4 rounded shadow">
    <div className="flex justify-between items-center mb-2">
      <h3 className="font-semibold">Latest Blocks</h3>
      <button className="text-blue-600 text-sm">View All</button>
    </div>
    <ul className="space-y-2">
      {[1, 2, 3, 4, 5].map(i => (
        <li key={i} className="text-sm border p-2 rounded flex justify-between">
          <div>
            Block #{123450 + i}
            <div className="text-xs text-gray-500">Validated by: Node{i}</div>
          </div>
          <div className="text-xs text-gray-600">5 secs ago</div>
        </li>
      ))}
    </ul>
  </div>
);

const LatestTransactions = () => (
  <div className="bg-white p-4 rounded shadow">
    <div className="flex justify-between items-center mb-2">
      <h3 className="font-semibold">Latest Transactions</h3>
      <button className="text-blue-600 text-sm">View All</button>
    </div>
    <ul className="space-y-2">
      {[1, 2, 3, 4, 5].map(i => (
        <li key={i} className="text-sm border p-2 rounded flex justify-between">
          <div>
            TxHash...{i}f{i}e
            <div className="text-xs text-gray-500">From: 0xAb...cd{i}</div>
          </div>
          <div className="text-xs text-gray-600">4 secs ago</div>
        </li>
      ))}
    </ul>
  </div>
);

export default Home;
